import time
from dataclasses import dataclass
from typing import Optional

from taoAsync.distributedId import generate_id
from utils.timestamp import get10BitUtcTs


@dataclass
class Object:
    id: int
    otype: str
    data: dict
    createAt: int
    updateAt: int

    @classmethod
    def create(cls, oid: int, otype: str, data: dict, createAt: int = None):
        now = get10BitUtcTs()
        if isinstance(createAt, int):
            t = min(createAt, now)
        else:
            t = now
        if not isinstance(oid, int):
            raise ValueError('Error id type.')
        if oid is None:
            raise ValueError('Empty id value.')

        return cls(
            id=oid,
            otype=otype,
            data=data,
            createAt=t,
            updateAt=t,
        )

    @classmethod
    def create_by_dict(cls, d: dict):
        return cls(
            id=d['id'],
            otype=d['otype'],
            data=d['data'],
            createAt=d['createAt'],
            updateAt=d['updateAt'],
        )


@dataclass
class Association:
    id: int
    id1: int
    id2: int
    atype: str
    createAt: int
    updateAt: int
    data: Optional[dict]

    @classmethod
    def create(cls, id1: int, id2: int, atype: str, data: dict):
        t = int(time.time())

        return cls(
            id=generate_id(0),
            id1=id1,
            id2=id2,
            atype=atype,
            createAt=t,
            updateAt=t,
            data=data
        )

    @classmethod
    def create_by_dict(cls, d: dict):
        return cls(
            id=d['id'],
            id1=d['id1'],
            id2=d['id2'],
            atype=d['atype'],
            createAt=d['createAt'],
            updateAt=d['updateAt'],
            data=d['data']
        )
